import Input from './Input';
import formData from '../data/formData';

function Form() {
  formData.map((e)=>{
    console.log(e.labelName);
    return (
      <form className="flex flex-col" action="#">
      <p>aaa</p>
      <Input
        labelName={e.labelName}
        forInput={e.forInput}
        typeInput={e.typeInput}
        placeholderInput={e.placeholder}
        /></form>)
      })}

      export default Form;
